import React, { useEffect, useState } from 'react';

 import {  Container,CircularProgress } from '@mui/material';
import axios from "axios"
import DataManipulation from './components/DataManipulation';


let image=[
  "data:image/jpeg;base64,","data:image/jpeg;base64,","https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQrJhIZsST0jinQ0OubWSKFI0FmXAbWRHOm8g&usqp=CAU","https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRBUp138EzcOCPWlca0vIA6Lsbv5MXFFaW5Vg&usqp=CAU","https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQaujxsQ6I3LwAfkvlH08Ub6c3-oS2RGWD_Jg&usqp=CAU","https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ9wH_g3T2i2et4NyyvY7mk7GUTcLdn0FqXCw&usqp=CAU","https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSXyRN59outPmSou3gcwUo_E85ZVBRvnzMI-A&usqp=CAU","https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS9nVA5ocmZnL3RXzMvf1AIk6Lq22_9LpNqPPJ4Nxk7YfxJJSUH-bGK1x7cTlfmG83DKsI&usqp=CAU","https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQz3_hh54SQfBUUoVYMdwSl8zufpKcDxfqS14pYnNTxLN_fpe7_hw_lKCDkjuuluZanbec&usqp=CAU","https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQz3_hh54SQfBUUoVYMdwSl8zufpKcDxfqS14pYnNTxLN_fpe7_hw_lKCDkjuuluZanbec&usqp=CAU","https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTticC1RUks_9Gj9BDHYa63VghZ-NUz87FMpZY_XDq58o8_7cabyjnR_eHuvtvPPyCeJ3M&usqp=CAU","data:image/jpeg;base64,","data:image/jpeg;base64,","https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQrJhIZsST0jinQ0OubWSKFI0FmXAbWRHOm8g&usqp=CAU","https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRBUp138EzcOCPWlca0vIA6Lsbv5MXFFaW5Vg&usqp=CAU","https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQaujxsQ6I3LwAfkvlH08Ub6c3-oS2RGWD_Jg&usqp=CAU","https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ9wH_g3T2i2et4NyyvY7mk7GUTcLdn0FqXCw&usqp=CAU","https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSXyRN59outPmSou3gcwUo_E85ZVBRvnzMI-A&usqp=CAU","https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS9nVA5ocmZnL3RXzMvf1AIk6Lq22_9LpNqPPJ4Nxk7YfxJJSUH-bGK1x7cTlfmG83DKsI&usqp=CAU","https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQz3_hh54SQfBUUoVYMdwSl8zufpKcDxfqS14pYnNTxLN_fpe7_hw_lKCDkjuuluZanbec&usqp=CAU","https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQz3_hh54SQfBUUoVYMdwSl8zufpKcDxfqS14pYnNTxLN_fpe7_hw_lKCDkjuuluZanbec&usqp=CAU","https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTticC1RUks_9Gj9BDHYa63VghZ-NUz87FMpZY_XDq58o8_7cabyjnR_eHuvtvPPyCeJ3M&usqp=CAU",

]
const columns = [
  {
    field: 'image',
    headerName: 'Image',
    width: 85,
    renderCell: (params) => <img src={params.row.img} alt="Product" style={{ width: '100%' }} />,
  },
  { field: 'name', headerName: 'Name', width: 150 },
  { field: 'brand', headerName: 'Brand', width: 200 },
  { field: 'category', headerName: 'Category', width: 300 },
  { field: 'mrp', headerName: 'Price', width: 120 },
];

const App = () => {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(false);

  useEffect(() => {
    const generateRandomKey = () => Math.random().toString(36).substring(7);

    const fetchData = async (page) => {
      try {
        const response = await axios.get(`https://catalog-management-system-dev-ak3ogf6zea-uc.a.run.app/cms/products?page=${page}`);
        
        const newData = response.data.products.map((el, i) => ({
          id: generateRandomKey(),
          img: image[Math.floor(Math.random() * 20)],
          name: el.name,
          brand: el.brand,
          category: el.main_category,
          mrp: +el.mrp.mrp,
          grossWeight: el.weights_and_measures.gross_weight,
          netWeight: el.weights_and_measures.net_weight,
          netContent: el.weights_and_measures.net_content,
          countryOrigin: el.country_of_origin,
        }));

        setData((prev) => [...prev, ...newData]);
        setLoading(false);
  
        if (page < 20) {
          await fetchData(page + 1);
        }
      } catch (error) {
        console.error('Error fetching data:', error);
        setError(true);
        setLoading(false);
      }
    };
  
    fetchData(1);
  }, []);

  return (
    <Container maxWidth="lg">
      {loading && (
        <div style={{
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
          height: '100vh',
        }}>
          <CircularProgress />
        </div>
      )}
      {error && (
        <div style={{
          backgroundColor: '#ffcccc',
          color: '#cc0000',
          padding: '10px',
          borderRadius: '4px',
          margin: '10px 0',
          fontSize: '18px',
        }}>
          Sorry, something went wrong. Please try again.
        </div>
      )}
      {!loading && !error && (
        <div style={{ width: '90%', marginTop: '10px', marginLeft: '30px' }}>
          <DataManipulation originalData={data} columns={columns} />
        </div>
      )}
    </Container>
  );
};

export default App;